// ../deno/src/utils/getPlugins.mjs
var getPlugins_default = async () => {
  const plugins = {
    toolboxes: [],
    blocks: ""
  };
  const blocks = [];
  await ensureDir(PLUGINS_DIR);
  try {
    for await (const file of Deno.readDir(PLUGINS_DIR)) {
      if (isLeadingDot(file.name))
        continue;
      if (file.isFile) {
        const str = await Deno.readTextFile(join3(PLUGINS_DIR, file.name));
        if (extname3(file.name) === ".json") {
          addItemToList(JSON.parse(str), plugins.toolboxes);
        } else if (extname3(file.name) === ".block") {
          addItemToList(str, blocks);
        } else if (extname3(file.name) === ".zip") {
          const buffer = await Deno.readFile(join3(PLUGINS_DIR, file.name));
          for (const { name, data } of await extract(buffer)) {
            const str2 = new TextDecoder().decode(data);
            if (extname3(name) === ".json") {
              addItemToList(JSON.parse(str2), plugins.toolboxes);
            } else if (extname3(name) === ".block") {
              addItemToList(str2, blocks);
            }
          }
        }
      } else if (file.isDirectory) {
        const subPath = join3(PLUGINS_DIR, file.name);
        for await (const subFile of Deno.readDir(subPath)) {
          if (isLeadingDot(subFile.name) || subFile.isDirectory)
            continue;
          const str = await Deno.readTextFile(join3(subPath, subFile.name));
          if (extname3(subFile.name) === ".json") {
            addItemToList(JSON.parse(str), plugins.toolboxes);
          } else if (extname3(subFile.name) === ".block") {
            addItemToList(str, blocks);
          }
        }
      }
    }
    plugins.blocks = blocks.map((block) => `(()=>{${block}})();
`).join("");
    plugins.toolboxes.sort(function(a, b) {
      return a.name.localeCompare(b.name, "zh");
    });
    return plugins;
  } catch (e) {
    if (!(e instanceof Deno.errors.NotADirectory)) {
      throw e;
    }
  }
};

// ../deno/src/utils/getAllProjects.mjs
var getAllProjects_default = async (dir) => {
  const projectsList = [];
  try {
    for await (const folder of Deno.readDir(dir)) {
      if (isLeadingDot(folder.name) || isLeadingUnderline(folder.name) || folder.isFile) {
        continue;
      }
      const jsonExists = await exists2(join3(dir, folder.name, "workspace.json"));
      if (folder.name !== "defaultProject" && folder.isDirectory && jsonExists) {
        projectsList.push(folder.name);
      }
    }
    const arr = projectsList.sort((a, b) => a.localeCompare(b));
    arr.unshift("defaultProject");
    return arr;
  } catch (error) {
    if (!(error instanceof Deno.errors.NotFound)) {
      throw error;
    }
  }
};

