var apiAutoSave_default = async (ctx) => {
  const { projectName, workspaceData } = await ctx.request.body.json();
  const jsonData = {};
  const time = Date.now();
  const backupDir = join3(Deno.env.PROJECTS_FOLDER, `${projectName}/workspace_backup`);
  const backupFile = join3(backupDir, `workspace-${time}.json`);
  workspaceData.forEach((item) => {
    const { title, type, data } = item;
    jsonData[title] = { type, data };
  });
  try {
    await ensureDir(backupDir);
    await Deno.writeTextFile(backupFile, JSON.stringify(jsonData, null, 2));
    console.log(`\u81EA\u52A8\u4FDD\u5B58: ${projectName}/workspace_backup/workspace-${time}.json`);
    const li = [];
    const keep = 20;
    for await (const dirEntry of Deno.readDir(backupDir)) {
      li.push(dirEntry.name);
      const keepLi = li.sort((a, b) => Number(a.slice(10, -5)) - Number(b.slice(10, -5))).slice(-keep);
      if (li.length > keep) {
        for (const item of li) {
          if (!keepLi.includes(item)) {
            await Deno.remove(join3(backupDir, item));
          }
        }
      }
    }
    ctx.response.body = "ok";
  } catch (err) {
    if (!(err instanceof Deno.errors.NotFound)) {
      throw err;
    }
  }
};

